import styled from "styled-components";

export const ContactMeWrapper = styled.div`
    display: block;
    justify-content: center-left;
    margin: auto;
    margin-top: 10px;
    width: 65%;
    margin-bottom: 200px;
`

export const EmailHeader = styled.h1`
    color: #fff;
    font-size: 30px;
`

export const Email = styled.a`
    font-size: 30px;
    color: #7ddfff;
    text-align: center;
`

export const EmailWrapper = styled.div`
      margin-top: 30px;
    text-align: center;
`
